Jung Rin is the former leader of the so-called failed group 'Pantetosan'. 3 years after his contract ended, he lived as an ordinary unemployed man, rather than an idol. One day, Pantetosan's once youngest member, currently a rising actor in his 20s, Yeon Seoho, met Rin.

&quot;You wrote this, right?&quot;

Seoho pushed a book towards Rin, and proposed to him with an elegant expression.

&quot;If you wrote this, do you have any thoughts in making this into a movie?&quot;
&quot;What......?&quot;

Rin kept rejecting but it was difficult to resist Seoho's stubborness.
He then made a proposal to Seonho...

&quot;From now on, 5 times....&quot;
&quot;5 times?&quot;
&quot;I want...you to go out with me on a date.&quot;

&quot;I know well that you can act well, it won't do if I can't check it by myself,&quot;

She was adopted by the devil-like count. Before dying, Hailynn lived her whole life being confined in a hut. When she opened her eyes she was 8 years old. She returned back in time right before she was to be adopted by the count.

Hailynn wanted to ask God... What was it that she had done wrong?!?!

She cursed God and threw herself out of the carriage that was en route to the count's estate. On that path, she met the Duke Kalisto, the representation of the sacred Vincent Kalisto.

But... &quot;She is of noble blood.&quot;

She thought she was an orphan but in actuality, she is actually the first daughter, in a thousand years, of the ducal household of Kalisto.

&quot;Am I really... the daughter?&quot;

However, Vincent has never approved of any woman and lived his life in abstinence. He swore he did not commit any act that may produce a child, thus he denies that he's the father...

&quot;...A monster?&quot;

What is the secret behind Hailynn's birth and the abrupt movement from the empire and the holy country?!

This is the first-time father, Vincent, and first-time daughter, Hailynn's clumsy yet lovely story.

A noble man in silk clothing appears in front of the fifteen year old Eun Hong, who is about to be sold off to the Courtesan house due to her father's debts.
He was the same man who occasionally bought the straw shoes that Eun Hong sold at the market.
After coming across him at the courtesan house, Eun Hong is sold off to him for a handsome sum of five hundred taels...

&quot;Until you are able to fulfill five hundred tael's worth of work, you are my bride. Will you marry me?&quot;
&quot;I cannot do such a thing because I do not love you.&quot;
&quot;I will give you 3 years. You can start paying back the five hundred taels after 3 years. Until then, all you need to do is pretend to be my bride.&quot;
&quot;Pretend to be your bride?&quot;

Choi Taewoong, the 21 year old leader of the Fire Dragon Trade business, the largest business in Joseon. He buys and sells everything with money, but will he be able to buy a bride with money as well?

Небесная наставница-цундере,, большегрудая сестренка-наставница, босоногая отравительница, фехтовальщица в белых чулках&hellip; Я, Е Гулоу &ndash; самый юный и самый одаренный культиватор на материке Юньлай, но, общими усилиями, мой гарем из несравненных красавиц вот-вот сведет меня в могилу!

Довольно! Пришло время вознестись на небеса! Увы, вместе со мной в другой мир отправились и они. А наутро гарем на рубеже двух миров вновь предстал перед моими глазами: эльфийка, зверодевушка, девушка-рыцарь и первосвященница. Теперь нельзя поручиться, что тело подростка, в котором находится моя девятисотлетняя сущность в одно прекрасное утро не лишится своего целомудрия.

И, похоже, мой гарем в новом мире будет лишь непрерывно расти&hellip;

&quot;Herbal medicine is recommended for an unstable heat!&quot;
&quot;I want to be strong since I'm an Omega.&quot; 
Azumi, an apprentice bartender, has been training his body with just this thought in mind. The huge change in his physique and body are the result of his all his hard work, but ironically, they throw his hormone balance out of whack. Now even when he takes a suppressant, his body can suddenly go into heat. In the midst of one of these attacks, he meets a suspicious man, who offers him a Chinese herbal medicine and gives him a business card for a Traditional Chinese Medicine shop...

I'm not a child anymore, says Honoka Miyama's former student... before kissing her!

It's been five years since Honoka became a teacher. With the arrival of a new batch of trainee teachers and her dream of an event from five years ago, Honoka finds a wave of nostalgia coming over her. Much to her surprise, the student she dreamed about, Tougo Ashiya, is among the new trainees! After the welcome party, Tougo invites Honoka to his place, where he soon reveals that his feelings for her haven't changed. Not letting her speak, he pulls her shirt open, sucking softly on her exposed chest as his hand slips down her thigh to a sensitive spot... &quot;Make sure you remember every detail of tonight.&quot;
The student she thought she knew shows a side of him she's never seen before!

The story of an &Omega; (Omega) girl who is torn between &quot;a favorite person&quot; and &quot;a man she wants&rdquo;. 

In addition to gender, the world has three &quot;attributes&quot;: elite &alpha; (alpha), ordinary human &beta; (beta), and &Omega; (omega) who go into estrus. Mio works as an apprentice to the bestselling author Aida. &quot;I loved the gentle Aida, but one day I met Kariya, my fated mate. There&rsquo;s someone else I like, but I want to do it with this man&hellip; I can't take it anymore! I should have been embraced by my favorite person, but I somehow ended up going into estrus with a man I just met!&quot;

